import cocacola from "../images/coca-cola.webp"
import Card from "../UI/Card";
const Dummy_Drink=[
  {
    id: Math.random(),
    name: "Lipton Ice-tea®",
    price: 1.99,
    src:lipton,
  },
  {
    id: Math.random(),
    name: "Lipton® Green Ice Tea",
    price: 1.99,
    src:liptonGreen,
