    price: 1.99,
    src:fanta,
  },
]


const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Sushi",
    description: "Finest fish and veggies",
    price: 22.99,
    src:california,
  },
  {
    id: "m2",
    name: "Schnitzel",
    description: "A german specialty!",
    price: 16.5,
    src:dragon
  },
  {
    id: "m3",
    name: "Barbecue ",
    description: "American, raw, meaty",
    price: 12.99,
    src:philadelphia,
  },
  {
    id: "m4",
    name: "Green Bowl",
    description: "Healthy...and green...",
    price: 18.99,
    src:dynamite,
  },
  {
    id: "m4",
    name: "Burger",
    description: "Healthy...",
    price: 18.99,
    src:shrimp,
  },
];
const AvailableMeals = () => {
